import request from "@/utils/request";
export default {
  add(params) {
    return request.post("/system/ip/white/add", params);
  },
  del(params) {
    return request.get("/system/ip/white/delete", { params });
  },
  list(params = {}) {
    return request.table("/system/ip/white/list", params, { method: "get" });
  }
};
